import React from 'react'
import NSSelect from '../components/NSSelect/index'

export default {
  title: 'New Story Select',
  component: NSSelect
}

export function NSSelectContainer() {

  return (
    <div>
      <h3>NS Select</h3>
      <NSSelect />
    </div>
  )
}
